import { colourTemplate } from './colours';

export const colours: colourTemplate = {
    background1: "#DDDDDD",
    background2: "#DDDDDD",
    fontPrimary: "#DDDDDD",
    fontSecondary: "#DDDDDD",
    fontTertiary: "#DDDDDD",
};

export const logoUrl: string = "../assets/Logo.png"
